import { Box, Tabs, TabList, Tab, TabLink, Section } from 'bloomer';
import DetailsTab from './DetailsTab';
import AlunosTab from './AlunosTab';

export default function Perfil() {
    return (
        <Box>
            <Tabs>
                <TabList>
                    <Tab isActive>
                        <TabLink>Detalhes</TabLink>
                    </Tab>
                    <Tab>
                        <TabLink>Alunos</TabLink>
                    </Tab>
                </TabList>
            </Tabs>

        </Box>
    )
}
